import React from 'react'
import { withStyles } from '@material-ui/core';

const useStyles = theme => ({
  container: {
    display: "flex",
    position :"fixed",
    alignItems:'center',
    width: '100vw',
    height: '100vh',
  },

  right: {
    padding: '15px',
    backgroundColor: '#424242',
    borderRadius: '20px',
    textAlign: 'center',
    [theme.breakpoints.down("sm")]:{
      width: '100%',
      height: '100%',
      borderRadius: '0px',
      overflowY: 'auto',
    },
  },

  left: {
    width: "70%",
    textAlign: 'center',
    [theme.breakpoints.down("sm")]:{
      display: 'none',
      width: "0vw",
    },

  },

})
export class SigninJs extends React.Component {
  render() {
    const { classes } = this.props;
    return (
      <div className={classes.container}>
        <div className={classes.left}>This is left</div>
        <div className={classes.right}>This is right</div>
      </div>
    )
  }
}

export default withStyles(useStyles)(SigninJs)
